import XCTest

final class ValidPalindromeII: XCTestCase {
  func testValidPalindrome() throws {
    let solution = Solution_680()
    XCTAssertTrue(solution.validPalindrome("aba"))
    XCTAssertTrue(solution.validPalindrome("abca"))
    XCTAssertFalse(solution.validPalindrome("abc"))
    XCTAssertFalse(solution.validPalindrome(""))
  }
}
